import React from "react";
import "./ExpenseItem.css";
export default function () {
  return (
    <>
      <div className="box">
        <div>March 28th 2021</div>
        <div>
          <h2>Car Insurance</h2>
          <div>$294.67</div>
        </div>
      </div>
    </>
  );
}
